I got to spend last night with some of the most talented broadcasters in the country. I was beyond honored & humbled to have been a part of it. Even though I didn’t take home a Marconi Award, I’ll never stop doing what I was born to do. Thank you for all of your love, support, and of course for listening. 
Congratulations to all of the winners and the incredibly talented people who were nominated. 
